import { TestBed } from '@angular/core/testing';

import { TransactionService } from './transaction.service';
import { of } from 'rxjs';
import { expectedTransactions } from '../../mock/transactions.mock';
import { last, take } from 'rxjs/operators';
import { CategoryCode, TransactionType } from '../enums/transaction';

describe('TransactionService', () => {
  let service: TransactionService;
  let httpClientSpy: { get: jasmine.Spy };

  beforeEach(() => {
    TestBed.configureTestingModule({});
    httpClientSpy = jasmine.createSpyObj('HttpClient', ['get']);
    httpClientSpy.get.and.returnValue(of(expectedTransactions));
    service = new TransactionService(httpClientSpy as any);
  });

  it('should be created', () => {
    expect(service).toBeTruthy();
  });

  it('should return all transactions (HttpClient called once)', () => {
    service.getTransactions().subscribe(
      transactions => expect(transactions).toEqual(expectedTransactions.data, 'expected transactions'),
      fail
    );
    expect(httpClientSpy.get.calls.count()).toBe(1, 'one call');
  });

  it('should search Amazon Online Store when keyword is amazon', () => {
    const amazon = {
      categoryCode: '#c12020',
      merchant: 'Amazon Online Store',
      merchantLogo: 'data:image/png;base64,',
    } as any;
    service.searchAvailableMerchants('amazon').subscribe(
      merchants => expect(merchants).toEqual([amazon], 'not correct result'),
      fail
    );
  });

  it('should return all merchants array when keyword is empty', () => {
    service.searchAvailableMerchants(null).subscribe(
      merchants => expect(merchants.length).toEqual(9, 'not correct result'),
      fail
    );
  });

  it('should validate amount based on the current balance', () => {
    const valid = service.validateAmount(50);
    const invalid = service.validateAmount(50000);
    expect(valid).toEqual(true, 'validation failed');
    expect(invalid).toEqual(false, 'validation failed');
  });

  it('should save all transactions to service scoped variable and emit change via behavior subject', () => {
    service.transactions$.pipe(
      take(2),
      last()
    ).subscribe(
      transactions => {
        expect(transactions).toEqual(expectedTransactions.data, 'loaded value is not emitted');
        expect(service.transactions).toEqual(expectedTransactions.data, 'loaded value is not saved');
      },
      fail
    )
    service.loadTransactions();
  });

  it('should save new transaction to service scoped variable and emit change via behavior subject', () => {
    service.transactions$.pipe(
      take(3),
      last()
    ).subscribe(
      transactions => {
        expect(transactions.length).toEqual(expectedTransactions.data.length + 1, 'loaded value is not emitted');
        expect(service.transactions.length).toEqual(expectedTransactions.data.length + 1, 'loaded value is not saved');
      },
      fail
    );
    service.balance$.pipe(
      take(2),
      last()
    ).subscribe(
      balance => {
        expect(balance).toEqual(5324.76, 'balance is not matching');
        expect(service.balance).toEqual(5324.76, 'balance is not saved');
      },
      fail
    );
    service.loadTransactions();
    service.transferMoney({
      amount: 500,
      categoryCode: CategoryCode.BuddhaGold,
      merchant: 'The Dummy Company',
      merchantLogo: null,
      transactionDate: new Date().getTime(),
      transactionType: TransactionType.CardPayment
    });
  });
});
